css:
@-moz-document domain("roblox.com") {
.container-fluid {
    margin-right: auto;
    margin-left: auto;
    position: relative;
    text-align: left;
    z-index: 200;
    width: 970px;
    height: 36px;
}
.rbx-header .rbx-navbar li .nav-menu-title {
    font-size: 14.2px;
}
.rbx-header .rbx-navbar-icon-group {
    margin: 0;
    bottom: 33px;
    position: relative;
    line-height: 28px;
    float: right;
}
.rbx-header .navbar-search {
    box-sizing: border-box;
    margin-top: 6px;
    left: 562px;
    position: relative;
    border-radius: 8px;
}
}
